webpackJsonp([2059055313621],{3545:function(t,a){t.exports={data:{markdownRemark:{html:"<p>なんか架空の世界の服装を考えていたのだが、いや難しい。 今でも架空の世界の服装、と言われると手が硬直する。まず描けない。無理に描くと現実世界の服装になったり、実用性ナッシングの儀式的な衣装になってしまったりと、散々な結果になる。ここは今後の修行のポイントかもしれない。  ちなみに右側は2003年初め頃に全く同じキャラを描いたもの。進歩しているのかどうか、激しく微妙。多分していない。</p>",frontmatter:{cover:null,date:"2000-04-21T11:07:59+09:00",strDate:"2000/4/21",title:"男の子"}}},pathContext:{path:"/ja/blog/2000/04/21-boy/",langKey:"ja"}}}});
